import React from 'react';
import banner from './img/banner.jpg';

const Content = () => {
    return (
        <div>
            <div className='banner relative mt-10 '>
                <img src={banner} alt="" className=' w-[1245px] object-cover h-[675px] absolute'/>
                <div className='absolute bottom-0 left-0'>
                    <span>Sweat-Wicking Performance</span>
                    <span>With a cropped silhouette for modern comfort that's made to move.</span>
                </div>
            </div>
        </div>
    );
};

export default Content;
